import SchoolInfoBox from './SchoolInfoBox';
import Courses from './Courses'; // Замените на ваш компонент для страницы курсов

function App() {
    return (
        <div className="app">
            <Router>
                <Navbar />
                <main>
                    {/* Здесь ваше основное содержимое */}
                    <h1>Содержимое вашего приложения</h1>
                    <Switch>
                        <Route exact path="/">
                            <RegistrationForm />
                        </Route>
                        <Route path="/school-info">
                            <SchoolInfoBox />
                        </Route>
                        <Route path="/courses">
                            <Courses />
                        </Route>
                    </Switch>
                </main>
            </Router>
        </div>
    );
}

export default App;
